The simplest approach to migrating to ratatui is to use it as drop in replacement for tui and updating the terminal libraries used (crossterm / termion). E.g.: tui = { package = "ratatui", version = "0.21.0", features = ["crossterm"] }
crossterm = { version = "0.26.1" } Or: tui = { package = "ratatui", version = "0.21.0", default-features = false, features = ["termion"] }
termion = { version = "2.0" }
